INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (157,'001','곳에는 밥 갈고 밭에는 책을 읽어 드디어 비단옷을 입고 고향에 돌아갑니다. 부지런히 수고한 뒤에는 수복이 스스로 오는 법입니다. 생산에 근심이 없으니 몸이 자연히 편안하겠습니다. 막력된 백일을 내지 마십시오. 도리어 손해가 있습니다. 밖과 여러사이에 경사가 있으니 대체로 금년의 여세는 이르는 곳마다 이덕이 있습니다. 호랑이가 산골짝 윗쪽을 위협하듯 의기양양하고 앞길이 환하니 하는 일마다 문제이 없이 마음 먹은대로 성사시킬 수 있습니다. 목소 단을 가지고 소로 바꾸는 격이니 의수가 말할 수 없이 좋습니다. 집안 많은 아들들이 다들 분가하여 땅 자리를 차려 나가고 순조롭게 며느들이 자리를 맡아 아버지의 가업을 이어받으니 재산은 날로 번성하게됩니다. 다만 흉험된 욕심을 부려 막력스럽게 계획을 부리면 손해가 있으니 주의해야합니다.','천지가 새로 부합한 격이니 반드시 경사스러운 일이 있겠습니다.서로간에 좋더 사이좋게 지내다보면 의외로 재물을 얻게될 것이며 두 사람이 한마음 한뜻이 되어 하고자하는 일을 해나간다면 별다른 협물없이 성사시킬 수 가 있을 것입니다.','집안 사람들에게 경사가 있게됩니다. 그렇지만 무턱대고 남의 재물에 욕심을 내지 안됩니다. 마음먹은 대로 쉽게되진 않겠으며 재물은 반드시 그만한 수고로움이 있는 후에야 얻게되는 법이니 이것이 바로 하늘이 준 복입니다.','마른나무가지가 이제 봄을 만나게되니 꽃을 피고 잎이 돋아나게 됩니다. 이렇게되니 사업을 하면 후회를 하지 못하더라도 반드시 경사스러운 일이 있을것입니다. 다만 친구사귐은 일을 조심해야합니다. 잘못하면 친구로 인하여 손해가 있게됩니다.','이성을 가까이 하지 마십시오. 이를 어기고 경망되이 행동하면 구설이 나를 무럽히겠습니다. 음과 양이 하나로 모아진 여세이므로 만물이 회생한 듯 즐겁기만 하겠습니다. 타인의 재물인데도 우연히 나에게로 와서 이익을 주겠습니다.','재물이 집안에 가득하니 많은 사람들이 부러워하고 사람 또한 희망하다고 우러러 봅니다. 이보다 더 좋은 신세가 있겠습니까. 여러곳에서 본바람이 불어옵니다. 그러나 다른 사람의 말을 너무 믿어서는 안됩니다. 나를 위하는척 하지만 결국은 속이게됩니다.','작은 물건으로 큰 물건을 바꾸게되니 재산이 남아 돌아가게 됩니다. 이십 성을 가진 사람이 다른 사람에 비해 더더욱 일하니 사람들과 손잡고 사업을 경영하면 어려운 사람을 돕고도 남아도는 재물이 있으니 즐겁기 그지없습니다.','술과 색을 가까이해서는 안됩니다. 주색으로 말미암아 손해가 있게되니 특히 삼가해야합니다. 주색으로 생긴보는 잘 낫지않아 치료하기 어려우니 처음부터 조심하지 않으면 안됩니다. 그리고 동북방향으로 여행이나 출타는 좋지않습니다. 길조가 바뀌어 흉재가 되게됩니다.','노력하여 땅을 파려야만 길하게되며 마지막는 모든 일이 대길하게 됩니다. 이달에는 다른 사람의 방해가 있을것이니 친한 친구라도 너무 가까이하지 말도록 하시고 자주 술집을 드나들지 마십시오. 술집에는 아무런 이익도 없으니 술을 삼가야합니다.','하늘이 복을 내리게 됩니다. 의수가 대길하여 하는일마다 성공하여 재물도 생기고 그리고 권력도 뒤따릅니다. 귀인이 나를 찾아와 힘껏 도와주게되어 안될일도 뜻밖에 성공하여 생각지도 않은 이익이 첨첨 넘치게됩니다.','공무원 시험을 치면 합격을 하겠습니다. 불합격되더라도 아들을 얻는것과 같은 기쁨이 있게 되겠습니다. 9월과 마찬가지로 재운이 왕성하며 많은 재물이 집대문으로 굴러 들어오게 됩니다. 그러나 사람을 잘못 사귀면 해를 낳치것이니 주의하십시오.','하고자하는 일들이 제때처럼 되게됩니다. 재물을 구하면 얻어지고 편안함을 원하면 편안하게되지만, 이달에 생기는 재물은 잠밖을 앗게되니 먼저 남에게 보시하십시요. 너무 욕심을 내면 넘치게되니 큰그릇에 물을 반만 담도록 하십시오.','신뢰가 있는 사람과 가까이 하게되면 모든 일이 성공하게됩니다. 부국공명이 적정에 달하니 사람마다 우러러 보지않는 사람이 없습니다. 그러나 자기분수에 맞지않게 너무 욕심을 내지 안됩니다. 하는 일들이 끝날 형통하게되고 말것입니다.','2025-03-02 03:02:00.858449+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (370,'001','在这个地方，我研磨了米饭，在田野里读了一本书，最后穿丝绸衣服回家。勤奋工作后，恢复是您自己的。我不担心生产，所以我的身体自然舒适。没有一百天。相比之下，有损坏。外部和许多人之间都有一个斜坡，所以今年年底今年是美德。当老虎威胁着山上的上侧时，凯旋和道路被交换。这是将声音转换为牛的前所未有的方式。家庭的许多儿子都分为地面，女孩们照顾自己的家并接管父亲的家族企业。但是，如果您打算计划丑陋的贪婪，则应小心。','天地是新一致的，所以一定有一个草率的东西。','房子里的人会倾向于。但是，您不应该为他人的财富贪婪。这不会像您那样容易，而财富是在您辛勤工作之后获得的一种方式。这是天堂的祝福。','干树枝现在遇到春天，花朵绽放，叶子萌芽。因此，如果您开展业务，即使您不后悔，也会倾斜。但是朋友必须小心工作。如果您做错了，您将被朋友损坏。','不要接近理性。如果您打破这一点并努力采取行动，那么合并将结束。阴和阳聚集在一起，因此会很有趣，就好像所有事物都被重生一样。即使是他人的财富，我也会偶然地来找我。','由于财富到处都是家庭，因此许多人羡慕不已，人们也希望。有比这更好吗？风从许多地方吹来。但是您不应该太相信别人的话。我假装我，但最终我被欺骗了。','如果您用小东西更改大物体，则您的属性仍会保留并返回。具有二十个性行为的人比其他人的效果更大，因此，如果您与人合作并经营业务，那么帮助那些困难和留下来的人并不有趣。','您应该无法接近酒精。特别是损失损失，因此您必须避免。颜色中发生的光束无法很好地治愈，因此很难对其进行治疗，因此请从一开始就小心。而且旅行或从东北旅行不好。道路的长度变化，它变成了胸部材料。','您必须尝试在地面上长时间，最后一件事将要做。这个月，其他人会受到干扰，所以不要离你的亲密朋友太亲近，不要经常去酒吧。酒吧没有任何好处，因此您应该避免喝酒。','天空是有福的。每个牧师都成功，从而获得财富和权力。贵族来找我，帮助我帮助我，所以我想不到。','如果您参加公务员考试，我们将通过。即使您失败了，您也会有和一个儿子一样的快乐。与9月一样，运气很强，许多财富被滚入房屋。但是，如果犯错，请小心。','您想做的事情将是及时的。如果您有钱，如果您想感到舒适，您会感到舒适，但是本月的财富会下床。如果您太贪婪了，您会溢出，所以让我们将一半的水放在一个大碗中。','如果您接近一个值得信赖的人，一切都会成功。由于富裕的国家共鸣是适当的，因此没有人看到人。但是，您不能太贪婪，无法适合您的喷泉。这项工作将是末尾。','2025-03-02 03:02:00.858449+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (441,'001','その場所で、私はご飯を挽いて畑で本を読み、最終的に絹の服を着て家に帰ります。熱心に働いた後、修復は自分でやって来ます。私は生産について心配していないので、私の体は自然に快適です。百日はありません。対照的に、損傷があります。外と多くの間に斜面があるので、今年の今年の終わりは美徳です。トラが山の上部を脅かすと、勝利と道路が交換されます。これは、声を変換して牛に変える前例のない方法です。家族の息子の多くは地面に分かれており、少女たちは自分の家の世話をして父親の家族経営を引き継ぎます。ただし、醜い貪欲を計画する場合は、注意する必要があります。','天と地は新しく一貫しているので、ずさんなものがなければなりません。','家の中の人々は傾いています。しかし、あなたは他人の富に貪欲であってはなりません。あなたが持っているほど簡単ではなく、富はあなたがその大変な仕事をした後に得る方法です。これは天国の祝福です。','乾燥した木の枝が春に会い、花が咲き、葉が芽を出します。したがって、あなたがビジネスをするなら、あなたはそれを後悔することができなくても傾斜します。しかし、友達は仕事に注意する必要があります。間違っていると、友達に損傷を受けます。','理性に近づかないでください。これを壊して一生懸命行動すると、統合は終わります。陰と陽が集まっているので、すべてのものが再生されたかのように楽しいでしょう。それは他の人の富ですが、私は偶然私のところに来ます。','富は家庭でいっぱいであるため、多くの人々はうらやましく、人々も望んでいます。これよりも優れていますか？風は多くの場所から吹きます。しかし、あなたは他の誰かの言葉をあまり信じてはいけません。私は私のふりをしますが、最終的に私はだまされています。','小さなもので大きなオブジェクトを変更すると、あなたの財産は残り、戻ります。 20人のセックスを持つ人は他の人よりもさらに多くのものであるため、人と協力してビジネスを運営している場合、困難で留まる人を助けるのは楽しいことではありません。','あなたはアルコールに近づくことができないはずです。特に、損害の損失があるので、控える必要があります。色で発生するビームはよく癒されていないため、治療することは困難ですので、最初から注意してください。そして、旅行または北東部から出て行くことは良くありません。道路の長さは変化し、胸部材料になります。','あなたは長くなるために地面に行こうとする必要があり、最後のことは行われます。今月は、他の誰かからの干渉がありますので、親しい友人に近づきすぎず、頻繁にバーに行かないでください。バーにはメリットはないので、飲酒を控えるべきです。','空は祝福されています。それぞれの司祭は成功しており、富と権力をもたらします。貴族は私のところに来て、私が私を助けてくれるのを手伝ってくれるので、私はそれを考えることができません。','あなたが公務員試験を受けるならば、私たちは合格します。失敗したとしても、息子を獲得するのと同じ喜びがあります。 9月のように、運は強く、多くの富が家に集まっています。しかし、あなたが間違いを犯した場合は注意してください。','あなたがやりたいことはタイムリーになります。豊かさを得ると、快適になりたいなら快適になりますが、今月の富はベッドから外れます。あなたがあまりにも貪欲であれば、あなたはオーバーフローしますので、水の半分を大きなボウルに入れましょう。','信頼できる人に近づくと、すべてが成功します。裕福な国の共鳴が適切であるため、誰も人を見ることはありません。しかし、あなたはあなたの噴水に合うにはあまりにも貪欲ではありません。作業は終わりの終わりになります。','2025-03-02 03:02:00.858449+00','j');
